import Login from '../components/Login';
import SignUp from '../components/SignUp';

const routes = [
  { 
    path: '/login', 
    name: "Login",
    component: Login 
  },
  { 
    path: '/signup', 
    name: "Sign Up",
    component: SignUp 
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
